function Players() {

    let rawData = [
        {
            "name": "Bernd Leno",
            "price": 5.0,
            "total_points": 131,
            "minutes": 3131,
            "ppm": 0.04183966783775152,
            "ppp": 26.2,
            "ppppm": 0.008367933567550303
        },
        {
            "name": "Rúnar Alex Rúnarsson",
            "price": 4.0,
            "total_points": 1,
            "minutes": 15,
            "ppm": 0.06666666666666667,
            "ppp": 0.25,
            "ppppm": 0.016666666666666666
        },
        {
            "name": "Willian Borges Da Silva",
            "price": 6.5,
            "total_points": 78,
            "minutes": 1398,
            "ppm": 0.055793991416309016,
            "ppp": 12.0,
            "ppppm": 0.008583690987124463
        },
        {
            "name": "Pierre-Emerick Aubameyang",
            "price": 10.0,
            "total_points": 131,
            "minutes": 2330,
            "ppm": 0.056223175965665236,
            "ppp": 13.1,
            "ppppm": 0.0056223175965665236
        },
        {
            "name": "Cédric Soares",
            "price": 4.5,
            "total_points": 28,
            "minutes": 744,
            "ppm": 0.03763440860215054,
            "ppp": 6.222222222222222,
            "ppppm": 0.008363201911589008
        },
        {
            "name": "Alexandre Lacazette",
            "price": 8.5,
            "total_points": 129,
            "minutes": 1916,
            "ppm": 0.06732776617954071,
            "ppp": 15.176470588235293,
            "ppppm": 0.00792091366818126
        },
        {
            "name": "Bernd Leno",
            "price": 5.0,
            "total_points": 131,
            "minutes": 3131,
            "ppm": 0.04183966783775152,
            "ppp": 26.2,
            "ppppm": 0.008367933567550303
        },
        {
            "name": "Rúnar Alex Rúnarsson",
            "price": 4.0,
            "total_points": 1,
            "minutes": 15,
            "ppm": 0.06666666666666667,
            "ppp": 0.25,
            "ppppm": 0.016666666666666666
        },
        {
            "name": "Willian Borges Da Silva",
            "price": 6.5,
            "total_points": 78,
            "minutes": 1398,
            "ppm": 0.055793991416309016,
            "ppp": 12.0,
            "ppppm": 0.008583690987124463
        },
        {
            "name": "Pierre-Emerick Aubameyang",
            "price": 10.0,
            "total_points": 131,
            "minutes": 2330,
            "ppm": 0.056223175965665236,
            "ppp": 13.1,
            "ppppm": 0.0056223175965665236
        },
        {
            "name": "Cédric Soares",
            "price": 4.5,
            "total_points": 28,
            "minutes": 744,
            "ppm": 0.03763440860215054,
            "ppp": 6.222222222222222,
            "ppppm": 0.008363201911589008
        },
        {
            "name": "Alexandre Lacazette",
            "price": 8.5,
            "total_points": 129,
            "minutes": 1916,
            "ppm": 0.06732776617954071,
            "ppp": 15.176470588235293,
            "ppppm": 0.00792091366818126
        },
    ]
    
    const [data, setData] = useState(rawData);

    // useEffect(() => {
    //     fetch('http://127.0.0.1:8000/api/app/')
    //     .then(res => res.json())
    //     .then(data => {
    //         setData(data);
    //     })
    //     .catch(err => {
    //         console.log(err);
    //     });
    // }, []);

    return (
        <div id="players-main">
            <div id="search-bar-container">
                <input type="text" id="search-bar" placeholder="Search" onKeyDown={() => {
                    let searchWord = document.getElementById('search-bar').value;
                    let newData = data.filter(function(player) {
                        return player.name.includes(searchWord)
                    })
                    if (searchWord === '') {
                        setData(rawData)
                    }
                    setData(newData)
                }}></input>
            </div>
            <div id="players-container">
                {data.map((player) => {
                    const { name, price, total_points, minutes, ppm, ppp, ppppm } = player;
                    return (
                        <Player name={name} price={price} total_points={total_points}
                        minutes={minutes} ppm={ppm} ppp={ppp} ppppm={ppppm} />
                    )
                })}
            </div>
        </div>
    )
}

function Player(props) {
    return (
        <div id="player-box">
            <h3>{props.name}</h3>
            <p>Price: {props.price}</p>
            <p>Total points: {props.total_points}</p>
            <p>Minutes: {props.minutes}</p>
            <p>Points/minute: {props.ppm.toFixed(4)}</p>
            <p>Points/price: {props.ppp.toFixed(4)}</p>
            <p>Points/price/minute: {props.ppppm.toFixed(4)}</p>
        </div>
    )
}



export default Players;
